import CenterLocation from '../components/CenterLocation';

function Home() {
  return (
    <div className="home">
      {/* Hero Section */}
      <HeroSection />

{/* Main Objective Section */}
      <MainObjective />



      {/* Developing Stars Section */}  
      <DevelopingFutureStars />
      
